import React from "react";

export class Counter extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0
    };
  }

  // Your event handlers
  render() {
    return (
      <div>
        <h1 id="counter">{this.state.counter}</h1>
        <button id="decrement" type="button" onClick={() => {
          this
        }}>Decrement</button>
        <button id="increment" type="button">Increment</button>
      </div>
    );
  }
}
